import React from 'react';
import './Zara.css';
import { Link } from 'react-scroll';

function Zara() {
  return (
    <>
      <div className='zara-wrapper'>
        <Link>
          <h1 className='name'>
            ZARA
            <br /> RAHIM
          </h1>
        </Link>
      </div>
    </>
  );
}

export default Zara;
